import React from 'react';
import { BoxCard, Image, Title, SubTitle } from './style';

export default function CardItem({item}) {

    return (
        <>
            <BoxCard>
                <Image src={item.image}></Image>
                <Title>{item.title}</Title>
                <SubTitle>{item.subtitle}</SubTitle>
            </BoxCard>
        </>
    )
}
